today @nayelilovera and Wyatt have a very fun first date with @peja and Shea (yes, Peja and Shae are just friends, @rydertullymusic had to leave early so Shea is standing in lol)  Shea and Wyatt from @TheOhanaAdventure and @OhanaBoys are the best to film with! and of course @Fayeknightlyis along to double third whee! this isn't just a typical first date as the two couples have to review a 5 Star VS a 1 Star restaurant! can they have a fun date at either restaurant? or does money buy happiness and good food? watch until the end to find out! comment which restaurant you would choose in the comments and if Nayeli and the Rock Squad should fly to Scotland to visit the Ohanas this summer? can we get this video on youtube trending? if you think its as fun as we do please make sure to share!! thanks for watching Rock Fam! we lysm! xoxo
